package main

import (
	"context"
	"github.com/go-redis/redis/v8"
)

var ctx = context.Background()

func main() {
	rdb := redis.NewClient(&redis.Options{
		Addr:     "localhost:6379",
		Password: "", // no password set
		DB:       0,  // use default DB
	})
	key := ""
	err := rdb.Set(ctx, key, "value", 0).Err()
	if err != nil {
		panic(err)
	}

	//fmt.Println(rdb.Get(ctx, key))
}
